import { createSlice } from "@reduxjs/toolkit";

export const shoppingSlice = createSlice({
  name: "shopping",
  initialState: {
    balance: 100000000000,
    products: [
      {
        id: 1,
        name: "Hamburger",
        quantity: 0,
        price: 2,
        image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSeWhbuUy8bAEaTOuF2twmsjHmOtB1Z2x8yxQ&usqp=CAU",
      },
      {
        id: 2,
        name: "Coca-Cola",
        quantity: 0,
        price: 1,
        image: "https://www.pngarts.com/files/4/Coca-Cola-Can-PNG-Image-Transparent-Background.png",
      },
      {
        id: 3,
        name: "Waffle",
        quantity: 0,
        price: 2,
        image: "https://cdn.getiryemek.com/products/1644327755090_1000x750.jpeg",
      },
      {
        id: 4,
        name: "AirPods",
        quantity: 0,
        price: 150,
        image: "https://www.pngmart.com/files/13/Apple-Airpods-Transparent-Background.png",
      },
      {
        id: 5,
        name: "iPhone",
        quantity: 0,
        price: 850,
        image: "https://3g.co.uk/userfiles/product/631b4dc9a4ae5-iphone-14-pro-max-purple.jpg",
      },
      {
        id: 6,
        name: "Bike",
        quantity: 0,
        price: 1500,
        image: "data:image/jpeg;base64,",
      },
      {
        id: 7,
        name: "Motorcycle",
        quantity: 0,
        price: 50000,
        image: "data:image/jpeg;base64,",
      },
      {
        id: 8,
        name: "Car",
        quantity: 0,
        price: 15000000,
        image: "data:image/jpeg;base64,",
      },
    ],
    totalPayment: 0,
  },
  reducers: {
    sellProduct: {
      reducer: (state, action) => {
        const product = state.products.find(
          (product) => product.id === action.payload
        );
        product.quantity -= 1;
        state.totalPayment -= product.price;
        state.balance += product.price;
      },
    },
    buyProduct: {
      reducer: (state, action) => {
        const product = state.products.find(
          (product) => product.id === action.payload
        );
        product.quantity += 1;
        state.totalPayment += product.price;
        state.balance -= product.price;
      },
    },
  },
});

export const { sellProduct, buyProduct } = shoppingSlice.actions;
export default shoppingSlice.reducer;
